function Apply() {
  const handleApply = () => {
    alert('You applied successfully!');
  };

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold">Application Details</h1>
      <p><strong>Company:</strong> Desi Developer</p>
      <p><strong>Website:</strong> https://google.com</p>
      <p><strong>Your Name:</strong> Sargam Sandip Shirke</p>
      <p><strong>Address:</strong> Mumbai, Maharashtra</p>
      <button onClick={handleApply} className="mt-4 bg-blue-500 text-white px-4 py-2 rounded">Confirm Apply</button>
    </div>
  );
}

export default Apply;
